            imgheight = Img_Source.Height;
            //Source_Image.Width = imgwidth;
            //Source_Image.Height = imgheight;
            Source_Image.Image = Img_Source;
            }

       public string GetBase64String(string Path)
        {
            try
            {
                byte[] binData = File.ReadAllBytes(Path);
                return Convert.ToBase64String(binData);
            }
            catch
            {
                return "failed";
            }
        }
        public byte [] GetFromBase64String(string base64String)
        {
            try
            {
                return Convert.FromBase64String(base64String);
            }
            catch
            {
                return (byte[])null;
            }
        }
        public Image byteArrayToImage(byte[] byteArrayIn)
        {
            MemoryStream ms = new MemoryStream(byteArrayIn);
            Image returnImage = Image.FromStream(ms);
            return returnImage;
        }

    }
